import React from "react";
import "../page/style/BoardLayout.css";
import RightBox from "./RightBox";
function BoardLayout() {
  return (
    <div className="BoardLayout">
      <div className="mainBox">
        <div className="title">자유게시판</div>
        <div className="input">새 글을 작성해주세요!</div>
        <div className="content-box">
          <div className="post">
            <div className="post-title">광고와 미디어 책</div>
            <div className="post-content">
              시작하는데요! 5학년이고 사립초 재학중이며 토익 브릿지 목표로 하고
              있고, 현재로서는 jet 중급 수준이라고 합니다. 시간당 얼마를 받는게
              적
            </div>
            <div className="post-etc"></div>
          </div>
        </div>
      </div>
      <div className="rightBox"></div>
      <div className="clear"></div>
    </div>
  );
}

export default BoardLayout;
